import React,{useState} from 'react'

interface IState{
    count : Number
}

interface example{
    name:String
}
const Exapmle: React.FC<example>=({name}) => {
    const [num , setNum] = useState<IState>({
        count : 0
    })

  return (
    <div>
{name}
<h1>{num.count}</h1>
    </div>
  )
}

export default Exapmle
